import React, { useState } from 'react';
import {
  Container,
  Box,
  Typography,
  TextField,
  Button,
  Alert,
  Paper,
  Checkbox,
  FormControlLabel,
  Link,
} from '@mui/material';

function App() {
  const [username, setUsername] = useState('');
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [message, setMessage] = useState('');
  const [error, setError] = useState('');
  const [agree, setAgree] = useState(false);

  const handleRegister = async (e) => {
    e.preventDefault();
    setMessage('');
    setError('');

    if (!agree) {
      setError('You must agree to the Terms of service');
      return;
    }

    const response = await fetch('http://localhost:5000/api/auth/register', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ username, name, email, password }),
    });

    const data = await response.json();
    if (response.ok) {
      setMessage('Registration successful!');
      setUsername('');
      setName('');
      setEmail('');
      setPassword('');
      setAgree(false);
    } else {
      setError(data.message || 'Registration failed');
    }
  };

 return (
  <Container maxWidth="md">
    <Box
      mt={8}
      component={Paper}
      elevation={8}
      p={6}
      borderRadius={6}
      sx={{
        background: '#fff',
        minHeight: 550,
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        boxShadow: '0 8px 32px rgba(0,0,0,0.08)',
      }}
    >
      <Typography variant="h3" fontWeight={700} align="center" gutterBottom>
        ResearchHive Registration
      </Typography>
      <form onSubmit={handleRegister} style={{ maxWidth: 480, margin: '0 auto' }}>
        <TextField
          label="Username"
          variant="outlined"
          fullWidth
          margin="normal"
          size="large"
          value={username}
          onChange={e => setUsername(e.target.value)}
          required
          autoFocus
        />
        <TextField
          label="Your Name"
          variant="outlined"
          fullWidth
          margin="normal"
          size="large"
          value={name}
          onChange={e => setName(e.target.value)}
          required
        />
        <TextField
          label="Your Email"
          type="email"
          variant="outlined"
          fullWidth
          margin="normal"
          size="large"
          value={email}
          onChange={e => setEmail(e.target.value)}
          required
        />
        <TextField
          label="Password"
          type="password"
          variant="outlined"
          fullWidth
          margin="normal"
          size="large"
          value={password}
          onChange={e => setPassword(e.target.value)}
          required
        />
        <FormControlLabel
          control={
            <Checkbox
              checked={agree}
              onChange={e => setAgree(e.target.checked)}
              required
            />
          }
          label={
            <span>
              I agree all statements in{' '}
              <Link href="#" underline="hover">
                Terms of service
              </Link>
            </span>
          }
          sx={{ mt: 1 }}
        />
        <Button
          type="submit"
          variant="contained"
          color="primary"
          fullWidth
          size="large"
          sx={{ mt: 3, mb: 2, py: 2, fontWeight: 600, fontSize: '1.1rem', letterSpacing: 1 }}
        >
          Register
        </Button>
        <Box textAlign="center" mt={2}>
          <Link href="#" underline="hover">
            I am already member
          </Link>
        </Box>
        {message && <Alert severity="success" sx={{ mt: 2 }}>{message}</Alert>}
        {error && <Alert severity="error" sx={{ mt: 2 }}>{error}</Alert>}
      </form>
    </Box>
  </Container>
);
}

export default App;
